import styled from 'styled-components'

const Project = styled.div`
  min-width: 300px;
  /* height: 300px; */
  border: 1px dashed purple;
  // background: rgba(0, 255, 0, .1);
  // margin: 1rem;
  // row-wrap: wrap
`

export default function ProgrammingProject (props) {
  return <Project></Project>
}
